import React from "react";
import "../meio/meio.css";

function Meio({ dados }) {
  return (
    <div className="meio">
      {dados && (
        <div>
          <h2>Informações do Cliente</h2>
          <pre>{JSON.stringify(dados, null, 2)}</pre>
        </div>
      )}
    </div>
  );
}

export default Meio; // Exportação correta
